import logo from './logo.svg';
import './App.css';
import axios from 'axios'

function App() {
  let config = {
    headers: {
      "Authorization": "Bearer e061b9c4-8221-4eff-9662-d4160d732e41",
      "User-Agent": "test",
    }
  }

  const sendGetRequest = async () => {
    try {
      const resp = await axios.get(
        "https://api.squarespace.com/1.0/commerce/inventory", config
      );
      console.log(resp.data.inventory);
    } catch (err) {
      // Handle Error Here
      console.error(err);
    }
  };
  sendGetRequest();

  return (
    <div className="App">

    </div>
  );
}

export default App;
